import bisect


class Solution:
    def canReach(self, s: str, minJump: int, maxJump: int) -> bool:
        n = len(s)
        res = [n - 1]
        if s[-1] == '1': return False
        if len(s) < minJump: return False
        for i in range(n - 1)[::-1]:
            if s[i] == '0':
                idx = bisect.bisect_right(res, maxJump + i)
                if idx == 0:
                    return False
                # res = res[:idx]
                # if not res: return False
                if res[idx - 1] - i >= minJump:
                    res[0:0] = [i]
        return 0 in res

    def canReach2(self, s, minJ, maxJ):
        dp = [c == '0' for c in s]
        pre = 0
        for i in range(1, len(s)):
            if i >= minJ: pre += dp[i - minJ]
            if i > maxJ: pre -= dp[i - maxJ - 1]
            dp[i] &= pre > 0
        return dp[-1]


so = Solution()
print(so.canReach("01", 1, 1))
print(so.canReach(s="011010", minJump=2, maxJump=3))
print(so.canReach(s="01101110", minJump=2, maxJump=3))
print(so.canReach(
    "",
    5,
    99998))
